function TempAddAnswer() {
  return (
    <div className="wrapper">
      <div className="header">
        <div className="attribution">
          <img className="attributionAvatar" src="https://pbs.twimg.com/profile_images/822547732376207360/5g0FC8XX.jpg" />
          <p className="attributionUsername">@barackobama</p>
        </div>
      </div>
      <style jsx>{`
        .wrapper {
          border: 1px solid #ddd;
          width: 750px;
          margin: 0 auto;
        }
        .header {
          background: #fafafa;
          padding: 10px 8px;
          border-radius: 3px 3px 0 0;
          min-height: 39px;
        }
        .attribution {
          position: relative;
          top: 5px;
        }
        .attributionAvatar {
          width: 50px;
          border-radius: 50px;
          display: inline-block;
        }
        .attributionUsername {
          display: inline-block;
          margin-left: 10px;
          position: relative;
          bottom: 15px;
        }
      `}</style>
    </div>
  )
}

export default TempAddAnswer
